// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.28;

import { Token } from "./Token.sol";
import { FlashLoanProvider } from "./FlashLoanProvider.sol";

contract Exchange is FlashLoanProvider {
    // State variables
    address public feeAccount;
    uint256 public feePercent;
    uint256 public orderCount;

    // Mapping of orders
    mapping(uint256 => Order) public orders;
    mapping(uint256 => bool) public isOrderCancelled;
    mapping(uint256 => bool) public isOrderFilled;

    // Total tokens belonging to a user
    mapping(address => mapping(address => uint256))
        private userTotalTokenBalance;
    // Total tokens on an active order
    mapping(address => mapping(address => uint256))
        private userActiveTokenBalance;


    // Events
    event TokensDeposited(
        address token,
        address user,
        uint256 amount,
        uint256 balance
    );
    event TokensWithdrawn(
        address token,
        address user,
        uint256 amount,
        uint256 balance
    );
    event OrderCreated(
        uint256 id,
        address user,
        address tokenGet,
        uint256 amountGet,
        address tokenGive,
        uint256 amountGive,
        uint256 timestamp
    );
    event OrderCancelled(
        uint256 id,
        address user,
        address tokenGet,
        uint256 amountGet,
        address tokenGive,
        uint256 amountGive,
        uint256 timestamp
    );
    event OrderFilled(
        uint256 id,
        address user,
        address tokenGet,
        uint256 amountGet,
        address tokenGive,
        uint256 amountGive,
        address creator,
        uint256 timestamp
    );

    struct Order {
        // Atributes of an order
        uint256 id; // Unique identifier for the order
        address user; // User who made the order
        address tokenGet; // Address of the token they receive
        uint256 amountGet; // Amount they receive
        address tokenGive;  // Address of the token they give
        uint256 amountGive; // Amount they give
        uint256 timestamp; // When order was created
    }

    constructor(address _feeAccount, uint256 _feePercent) {
        feeAccount = _feeAccount;
        feePercent = _feePercent;
    }


    // -------------------------
    // DEPOSIT & WITHDRAW TOKENS

    function depositToken(address _token, uint256 _amount) public{
        // Update user balance
        userTotalTokenBalance[_token][msg.sender] += _amount;

        // Emit an event
        emit TokensDeposited(
            _token,
            msg.sender,
            _amount,
            userTotalTokenBalance[_token][msg.sender]
        );

        // Transfer tokens to exchange
        require(
            Token(_token).transferFrom(msg.sender, address(this), _amount),
            "Exchange: Token transfer failed"
        );
    }

    function withdrawToken(address _token, uint256 _amount) public {
        require(
            totalBalanceOf(_token, msg.sender) -
                activeBalanceOf(_token, msg.sender) >=
                _amount,
            "Exchange: Insufficient balance"
        );

        // Update the user balance
        userTotalTokenBalance[_token][msg.sender] -= _amount;

        // Emit an event
        emit TokensWithdrawn(
            _token,
            msg.sender,
            _amount,
            userTotalTokenBalance[_token][msg.sender]
        );

        // Transfer tokens back to user
        require(
            Token(_token).transfer(msg.sender, _amount),
            "Exchange: Token transfer failed"
        );

    }

    function totalBalanceOf(
        address _token,
        address _user
    ) public view returns (uint256) {
        return userTotalTokenBalance[_token][_user];
    }

    function activeBalanceOf(
        address _token,
        address _user
    ) public view returns (uint256) {
        return userActiveTokenBalance[_token][_user];
    }

    // -------------------------
    // MAKE & CANCEL ORDERS

    function makeOrder(
        address _tokenGet,
        uint256 _amountGet,
        address _tokenGive,
        uint256 _amountGive
    ) public {
        require(
            totalBalanceOf(_tokenGive, msg.sender) >=
                activeBalanceOf(_tokenGive, msg.sender) + _amountGive,
            "Exchange: Insufficient balance"
        );

        // Update the order
        orderCount++;

        // Instantiate a new order
        orders[orderCount] = Order(
            orderCount,
            msg.sender,
            _tokenGet,
            _amountGet,
            _tokenGive,
            _amountGive,
            block.timestamp
        );

        // Update the user's active balance
        userActiveTokenBalance[_tokenGive][msg.sender] += _amountGive;

        // Emit an event
        emit OrderCreated(
            orderCount,
            msg.sender,
            _tokenGet,
            _amountGet,
            _tokenGive,
            _amountGive,
            block.timestamp
        );        
    }

    function cancelOrder(uint256 _id) public {
        // Fetch the order
        Order storage order = orders[_id];

        // Oorder must exists
        require(order.id == _id, "Exchange: Order does not exist");

        // Ensure the caller of the function is the owner of the order
        require(address(order.user) == msg.sender, "Exchange: Not the owner");

        // Cancel the order
        isOrderCancelled[_id] = true;

        // Update user's active token balance
        userActiveTokenBalance[order.tokenGive][order.user] -= order.amountGive;

        // Emit an event
        emit OrderCancelled(
            order.id,
            msg.sender,
            order.tokenGet,
            order.amountGet,
            order.tokenGive,
            order.amountGive,
            block.timestamp
        );
    }

    // -------------------------
    // EXECUTE ORDERS

    function fillOrder(uint256 _id) public {
        // 1. Must be a valid order
        require(_id > 0 && _id <= orderCount, "Exchange: Order does not exist");
        // 2. Order can't be filled twice
        require(!isOrderFilled[_id], "Exchange: Order has already been filled");
        // 3. Order can't be cancelled
        require(!isOrderCancelled[_id], "Exchange: Order has been cancelled");

        // Fetch the order
        Order storage order = orders[_id];

        // Prevent filling if msg.sender already has the tokens listed
        require(
            totalBalanceOf(order.tokenGet, msg.sender) >=
                    activeBalanceOf(order.tokenGet, msg.sender) + order.amountGet,
            "Exchange: Insufficient balance"
        );

        // Execute the trade
        _trade(
            order.id,
            order.user,
            order.tokenGet,
            order.amountGet,
            order.tokenGive,
            order.amountGive
        );

        // Mark the order as filled
        isOrderFilled[order.id] = true;     
    }

    function _trade (
        uint256 _orderId,
        address _user,
        address _tokenGet,
        uint256 _amountGet,
        address _tokenGive,
        uint256 _amountGive
    ) internal{
        // Fee is paid by the user who fills the order (msg.sender)
        // Fee is deducted from _amountGet
        uint256 _feeAmount = (_amountGet * feePercent) / 100;

        // Execute ther trade
        // Let the user who creted the order get their tokens
        userTotalTokenBalance[_tokenGet][msg.sender] -= (_amountGet + _feeAmount);
        userTotalTokenBalance[_tokenGet][_user] += _amountGet;

        // Charge fee
        userTotalTokenBalance[_tokenGet][feeAccount] += _feeAmount;

        // Give the requested tokens to the msg.sender, and minus token balance from 
        // the user who created the order
        userTotalTokenBalance[_tokenGive][_user] -= _amountGive;
        userTotalTokenBalance[_tokenGive][msg.sender] += _amountGive;

        // Update the user's active token balance
        userActiveTokenBalance[_tokenGive][_user] -= _amountGive;

        // emit trade event
        emit OrderFilled(
            _orderId,
            msg.sender,
            _tokenGet,
            _amountGet,
            _tokenGive,
            _amountGive,
            _user,
            block.timestamp
        );

    }
}

