// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.28;

import { Token } from "./Token.sol";

interface IFlashLoanReceiver {
    function receiveFlashLoan(
        address token,
        uint256 amount,
        bytes memory data
    ) external;
}

// We don't want to deploy this contract. 
// We only want our Exchange contract to inherit this contract,
// thus we make it abstract.
abstract contract FlashLoanProvider {
    event FlashLoan(address token, uint256 amount, uint256 timestamp);

    function flashLoan(
        address _token,
        uint256 _amount,
        bytes memory _data
    ) public{
        // Get our current token balance
        uint256 tokenBalanceBefore = Token(_token).balanceOf(address(this));
        // Require this contract to have enough funds to send
        require(
            tokenBalanceBefore > 0,
            "FlashLoanProvider: Insufficient funds to loan"
        );


        // Send funds to msg.sender
        require(
            Token(_token).transfer(msg.sender, _amount),
            "FlashLoanProvider: Transfer failed"
        );

        // Ask for money back
        IFlashLoanReceiver(msg.sender).receiveFlashLoan(_token, _amount, _data);

        // Get our current token balance after the loan
        uint256 tokenBalanceAfter = Token(_token).balanceOf(address(this));

        // Require this contract to have received the money back
        require(
            tokenBalanceAfter >= tokenBalanceBefore,
            "FlashLoanProvider: Funds not received"
        );

        // emit event
        emit FlashLoan(_token, _amount, block.timestamp);
    } 
}

contracts/FlashLoanUser.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.28;

import { Token } from "./Token.sol";
import { Exchange } from "./Exchange.sol";
import {IFlashLoanReceiver} from "./FlashLoanProvider.sol";

contract FlashLoanUser is IFlashLoanReceiver {
    address exchange;

    event FlashLoanReceived(address token, uint256 amount );

    constructor(address _exchange) {
        exchange = _exchange;
    }

    function getFlashLoan(address _token, uint256 _amount) external{
        // Call exchange for flash loan
        Exchange(exchange).flashLoan(_token, _amount, "");
    }

    function receiveFlashLoan(
        address _token,
        uint256 _amount,
        bytes memory /* _data */
    ) external override {

        // Do something with our loan
        emit FlashLoanReceived(_token, Token(_token).balanceOf(address(this)));

        // Pay back the flash loan
        Token(_token).transfer(exchange, _amount);
    }

}

contracts/Token.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.28;

contract Token {
    string public name;
    string public symbol;
    uint8 public decimals = 18;
    uint256 public totalSupply;

    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;

    event Transfer(address indexed from, address indexed to, uint256 value);

    event Approval(
        address indexed owner, 
        address indexed spender, 
        uint256 value
    );

    constructor(
        string memory _name, 
        string memory _symbol, 
        uint256 _totalSupply
    ) {
        name = _name;
        symbol = _symbol;
        totalSupply = _totalSupply * (10 ** decimals);
        balanceOf[msg.sender] = totalSupply;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceOf[msg.sender] >= _value, "Token: Insufficient Funds");

        _transfer(msg.sender, _to, _value);

        return true;
    }

    function _transfer(address _from, address _to, uint256 _value) internal {
        require(_to != address(0), "Token: Recipient is Address 0");

        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;

        emit Transfer(_from, _to, _value);
    }

    function approve(
        address _spender, 
        uint256 _value
    ) public returns (bool success) {
        require(_spender != address(0), "Token: Recipient is Address 0");

        allowance[msg.sender][_spender] = _value;

        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    function transferFrom(
        address _from, 
        address _to, 
        uint256 _value
    ) public returns(bool success) {
        require(_value <= balanceOf[_from], "Token: Insufficient Funds");
        require(
            _value <= allowance[_from][msg.sender],
            "Token: Insufficient Allowance"
        );

        allowance[_from][msg.sender] -= _value;

        _transfer(_from, _to, _value);

        return true;
    }
}

